import{_ as e,c as a,o as i}from"./chunks/framework.14007894.js";const m=JSON.parse('{"title":"","description":"","frontmatter":{"layout":"home","hero":{"name":"Caciques","text":"Caribes","tagline":"Raíces Ancestrales","image":{"src":"/logo.png","alt":"CaribesTIC"},"actions":[{"theme":"brand","text":"Caciques","link":"/caciques/arichuna"},{"theme":"alt","text":"CaribesTIC","link":"https://caribestic.github.io/"}]},"features":[{"title":"Arichuna","details":"Este guerrero perteneció a la tribu de Los Jiraharas, ubicando su radio de acción, en la región de lo que hoy se conoce como Lara y parte de Yaracuy."},{"title":"Baruta","details":"El Cacique Baruta fue Mariche (nombre de una tribu de Venezuela que vivieron en lo que hoy es la zona de Filas de Mariche), es hijo del Gran Cacique Guaicaipuro y de Urquia."},{"title":"Catia","details":"Era un gran estratega con conocimientos en las artes curativas, le gustaba enseñar a los jóvenes guerreros. Ejercía su mando desde la fila que ocupaban Los Mariches, siguiendo toda la serranía que circunda a Caracas hasta el Litoral."},{"title":"Chacao","details":"Era un indio de mediados del Siglo XVI, llamado el Hércules Americano, gobernó en la región caraqueña que hoy lleva su nombre. El nombre Chacao deriva de Chacau, que significa arena, los Tamanacos decían Ciaccau y los Caribes Saccao."},{"title":"Chicuramay","details":"Cuaicurián - Chicuramay fue uno de los 23 caciques que fueron condenados a muerte después de la desaparición de Guaicaipuro, por una cruel decisión de la Alcaldía de Caracas. El alcalde los juzgó sin pruebas y los condenó a muerte."},{"title":"Guaicaipuro","details":"Es conocido actualmente como Guaicaipuro, pero en documentos de la época se le encuentra con el nombre de Guacaipuro II. Es uno de los Caciques más famosos e ilustres de Venezuela."},{"title":"Naiguatá","details":"Cacique aguerrido, fuerte, romántico y tenía un gran amor por las gaviotas. Ejerció sus dominios a lo largo de la zona costera desde el Río Anare hasta la región costeña hoy conocida como Puerto La Cruz."},{"title":"Paramaconi","details":"Paramaconi puede ser considerado el indio  de la pacificación. Los españoles lo llamaban el \\"Cacique-Caballero\\" pero el significado de su nombre es \\"Caimán Pequeño\\"."},{"title":"Sorocaima","details":"El nombre del Cacique Sorocaima significa \\"Pájaro de Vistoso Plumaje\\". Era un hombre rígido, severo y reservado. Fue un hombre de confianza del Gran Cacique Guaicaipuro."},{"title":"Tamanaco","details":"Lideró la feroz resistencia indígena contra la conquista y barbarie del imperialismo español. Su muerte, lejos de aniquilar el espíritu combativo de las tribus, los impulsó a radicalizar sus acciones sin temer por su destino."},{"title":"Terepaima","details":"Terepaima significa “Río que corre en el Valle”. Terepaima fue un guerrero muy hábil que hizo justicia en contra de los conquistadores."},{"title":"Tiuna","details":"Intrépido guerrero nacido en la tribu de los Caracas, crecio y formó en su infancia bajo la tutela del Cacique Catia. Se caracterizó por su rigidez y gran valentía. Su poder lo ejerció en el Valle de Los Guayabos, territorio conocido actualmente con el nombre de Catia La Mar."},{"title":"Urimare","details":"Urimare (1era mujer Cacique de nuestro pais) hija del  Cacique Aramaipuro quien la crió enseñándole estrategias para defenderse y defender a su pueblo."},{"title":"Urquia","details":"Urquía su nombre significa Ojos de Águila, pertenecía a la etnia de los Teques. Guerrera, cacica con el prototipo de mujer amazónica. Fue la esposa de Guaicaipuro, Madre de Baruta y de los hijos de Guaicaipuro."}],"footer":"MIT Licensed | Copyleft © 2022-present Ernesto Canquiz"},"headers":[],"relativePath":"index.md"}'),r={name:"index.md"};function o(s,n,t,c,l,u){return i(),a("div")}const p=e(r,[["render",o]]);export{m as __pageData,p as default};
